import './App.css';
import { todoData } from "./data";
function Todolist() {
  return (
    <div className="App">
        <p>
          Edit
        </p>
        <a>
          Learn React
        </a>
        <form>
            <h2 className="label-wrapper">
              <label>
              </label>
            </h2>
            <input type="text" name="text" />
            <button type="submit">Add
            </button>
          </form>
    </div>
  );
}

export default Todolist;
